import React from "react";

import {
  Drawer,
  Input,
  InputNumber,
  Select,
  Button,
  Form,
  Row,
  Col
} from "antd";

const ReservationDrawer = ({ visible, onClose }) => {
  return (
    <Drawer
      title="Reservation"
      width={420}
      closable={true}
      visible={visible}
      onClose={onClose}
    ></Drawer>
  );
};

export default ReservationDrawer;
